tables.table_schema:
CREATE TABLE QuantumExperimentMeasurements (
    measurement_id INT PRIMARY KEY,
    experiment_name VARCHAR(255),
    measurement_outcome VARCHAR(255),
    measurement_date TIMESTAMP
);

CREATE TABLE ExperimentParticipants (
    participant_id INT PRIMARY KEY,
    participant_name VARCHAR(255),
    experiment_id INT,
    FOREIGN KEY (experiment_id) REFERENCES QuantumExperimentMeasurements(measurement_id)
);

CREATE TABLE Experiment (
    id SERIAL PRIMARY KEY,
    experiment_name VARCHAR(255) NOT NULL,
    experiment_date TIMESTAMP NOT NULL,
    researcher_name VARCHAR(255) NOT NULL
);

CREATE TABLE Measurement (
    id SERIAL PRIMARY KEY,
    measurement_value FLOAT NOT NULL,
    experiment_id INT NOT NULL,
    FOREIGN KEY (experiment_id) REFERENCES Experiment(id)
);

CREATE TABLE Analysis (
    id SERIAL PRIMARY KEY,
    analysis_result TEXT NOT NULL,
    measurement_id INT NOT NULL,
    FOREIGN KEY (measurement_id) REFERENCES Measurement(id)
);
